import React, { useState, useEffect } from "react"
//import {csv, autoType} from "d3"
//import data from "./Components/states.json"
//import states from "./Components/states_obs.csv"
import "./App.css"
import Navbar from "./Components/Navbar"
import Section from "./Components/Section"
import dummyText from "./DummyText"
import { Table } from "react-fluid-table"
//import GeoChart from "./Components/GeoChart"


function App() {
  /* mandatory */

    return (
      <div className="App">
        <Navbar />
        <Section
          title="Financial Literacy in The U.S."
          subtitle={"Click on the state to see financial literacy grade"}
          dark={false}
          id="section1"
        />
        <Section
          title="Section 2"
          subtitle={"Kathia Vargas Feliz"}
          dark={false}
          id="section2"
        />
        <Section
          title="Section 3"
          subtitle={dummyText}
          dark={true}
          id="section3"
        />
        <Section
          title="Section 4"
          subtitle={dummyText}
          dark={false}
          id="section4"
        />
        <Section
          title="Section 5"
          subtitle={dummyText}
          dark={true}
          id="section5"
        />
      </div>
    );
}

export default App;
